import React from "react";
import "./App.css";

export const Item = React.memo(({ state }) => {
  // console.log("n = ", TODOitem);

  return (
    <React.Fragment>
      {state.map((item) => (
        <li key={item.id}>
          <span>{item.task}</span>
          <span>
            <i className="far fa-trash-alt delete"></i>
          </span>
        </li>
      ))}
    </React.Fragment>
  );
});
